  return (
    <div className="Step1">
      <div className="lander">
        <h1>Stap 1:</h1>
        <p>Klik op de knop volgende</p>
        <LinkContainer to="/step2">
          <Button variant="contained">Next</Button>
        </LinkContainer>
      </div>
    </div>
  );
}
